import React, { Component } from 'react'
import { Link, withRouter } from 'react-router-dom'
import AppBar from '@material-ui/core/AppBar';
import './Navbar.css';
import {loginRegLink} from './LoginRegLink'
import SvgIcon from '@material-ui/core/SvgIcon';
import Grid from '@material-ui/core/Grid';





class Navbar extends Component {
    logOut(e) {
        e.preventDefault()
        localStorage.removeItem('usertoken')
        console.log("See ya")
        this.props.history.push(`/`)
    }



        render() {

            function HomeIcon(props) {
                return (
                    <SvgIcon {...props}>
                        <path d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8z" />
                    </SvgIcon>
                );
            }
            const userLink = (

                <AppBar position="static" className="AppBarContainer">
                    <Grid container direction="row" justify="flex-start" alignItems="center" spacing={24}>

                    <ul className="AppBarContainer">
                        <Grid item xs={12}>
                            <Link to="/" >
                                <HomeIcon color="action" className="itemNav"/>
                            </Link>
                    </Grid>
                        <Grid item xs={12}>
                            <Link to="/profile" className="nav-link">
                                User
                            </Link>
                        </Grid>
                        <Grid item xs={12}>
                            <a href="#" onClick={this.logOut.bind(this)} className="nav-link">
                                Logout
                            </a>
                        </Grid>
                        <Grid item xs={12}>
                            <Link to="/createEvent" className="itemNav">
                                Create event
                            </Link>
                        </Grid>
                        <Grid item xs={12}>
                            <Link to="/allEvents" className="itemNav">
                                all events
                            </Link>
                        </Grid>
                    </ul>
                    </Grid>
                </AppBar>

            )
        return (
            <nav className="AppBarContainer">
                    {localStorage.usertoken ? userLink : loginRegLink}
            </nav>

        )
    }
}
export default withRouter(Navbar)
